import { Routes, Route } from 'react-router-dom';
import Navbar from './Navbar';
import './styles.css';

const Admin = () => {
  return (
    <div className="admin-container">
      <Navbar />
      <div className="admin-content">
        <Routes>
          
            <Route path="/admin" component={products}element={<h1>thtr</h1>}/>
          
        </Routes>
      </div>
    </div>
  );
};

export default Admin;
